import{_ as e,o as a,c as r,O as t}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 2.2-220.1 Chesapeake Bay Watershed Agreement; annual report.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/2.2-220.1.md","filePath":"vacode/2.2-220.1.md"}'),n={name:"vacode/2.2-220.1.md"},o=t('<h1 id="§-2-2-220-1-chesapeake-bay-watershed-agreement-annual-report" tabindex="-1">§ 2.2-220.1 Chesapeake Bay Watershed Agreement; annual report. <a class="header-anchor" href="#§-2-2-220-1-chesapeake-bay-watershed-agreement-annual-report" aria-label="Permalink to &quot;§ 2.2-220.1 Chesapeake Bay Watershed Agreement; annual report.&quot;">​</a></h1><p>By November 1 of each year, the Secretary of Natural and Historic Resources shall report to the Governor and the Chairs of the House Committee on Agriculture, Chesapeake and Natural Resources and the Senate Committee on Agriculture, Conservation and Natural Resources on the implementation of the 2014 Chesapeake Bay Watershed Agreement. The Secretary may use documents, reports, and other materials developed in cooperation with other signatories to the agreement, including the U.S. Environmental Protection Agency and other relevant federal agencies or nongovernmental organizations, to fulfill this reporting requirement.</p><p>2001, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?011+ful+CHAP0259" target="_blank" rel="noreferrer">259</a>, § 2.1-51.12:4; 2015, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?151+ful+CHAP0475" target="_blank" rel="noreferrer">475</a>; 2021, Sp. Sess. I, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0401" target="_blank" rel="noreferrer">401</a>.</p>',3),i=[o];function s(l,h,c,p,d,_){return a(),r("div",null,i)}const m=e(n,[["render",s]]);export{u as __pageData,m as default};
